import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("NotoSansThai-Regular-normal.ttf", font);
  this.addFont(
    "NotoSansThai-Regular-normal.ttf",
    "NotoSansThai-Regular",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
export default font;
